import React, { Component } from "react";

class Datatable extends Component {
  render() {
    const datacomponents = () => {
      return this.state.dataelements;
    };
    return (
      <div id="datatable" className="center">
        {datacomponents()}
      </div>
    );
  }
}

export default Datatable;
